                    "plainText": "2.5.1.3, Consider the following question asked in an Education tutorial:\n\"You're on your practicum placement in a new school and a student in your Science class has not done his/her homework for the second time this week. Another teacher tells you that the student is usually really good and probably just needs someone to talk to him/her. School policy states that you should give the student a lunch-time detention. What do you do?\"\nWhich of the following is an appropriate response in a tutorial?\nCheck 3 options.\n1. \"I don't know, I'd give the student a detention because it's school policy. You have to stop disrespectful behaviour quickly before it gets out of hand - they're probably just doing it because you are a practicum teacher.\"\n2. \"Hmm...I think it is best to talk to the student, see what is going on. Lots of different studies suggest that an abrupt change in attitude can be a reflection of problems that the student is facing outside of school.\"\n3. \"Who cares? It's only a week\".\n4. \"It depends on the student. I mean, if they're nice and co-operative in class, I'd be more inclined to talk to them, but if they're really disrespectful I might use it as a chance to discipline them.\n5. \"In this kind of situation there are a number of different actions that a practicum teacher might take. First of all, it is important to determine why the student hasn't been completing their homework: this can be done with a brief conversation. As Smith (2018) suggests, talking with a student should always be done before any other action is taken...\" etc.",
