                            "plainText": "2.5.5.5, Imagine that you are taking a course in Landscape Architecture. As part of the course you need to give a 10 minute group presentation on sustainable design for urban parks. The presentation needs to include:\n1. A definition of sustainable design for urban parks\n2. The principles for sustainable design\n3. Three examples of sustainable design for urban parks\n4. An analysis of each of the example parks in relation to the principles\nThere are four people in your group: you, James, Rie and Ali.\nWhat is the best way to divide the tasks*?\n(*an example, not the only way!)\nRefer to lesson 5.3a and 5.3b\nCheck one option.\nA. One person does one of each for the four points. For example, James writes the definition, you write the principles, Rie finds the examples and Ali writes an analysis for each of Rie's examples. You come together at the end and make the presentation.\nB. One person writes the definition and the principles of sustainable design, and the other three each find an example and then analyze it according to the principles. C. You come together at the end and make the presentation.\nD. Everyone works on everything together as a team.\nThree people do everything and the last person presents it to the class.",
