                                    "plainText": "4.1.5.3, Throughout high school Tomoko had hoped to go to university and study something creative. She always enjoyed drama and art classes at school, and even received a prize for her artwork in her final year of school. Tomoko got a very good mark in her university entrance exam and her parents convinced her to study business law. Unfortunately, throughout her first year she has struggled with motivation.\nWhat are some things Tomoko could try in order to stay motivated at university, according to lesson 1.3b?\nCheck three options.\n\n1. She could employ cognitive behavioural therapy to change some of her habits.\n2. She could identify her key strengths in the course and how to use them.\n3. She could plan her time better.\n4. She could try positive visualisation and imagine herself as successful.\n5. She should keep things in her life in balance, and make sure she has time for activities outside university such as meeting friends, exercising or practicing her art.\n6. She could think about her personal values and goals and whether they align with her course of study.",
